import React from "react";
import MainNavigation from "../components/MainNavigation";
import { Outlet } from "react-router";

const RootLayoutPage = () => {
  return (
    <>
      <MainNavigation />
      <Outlet />
    </>
  );
};

export default RootLayoutPage;
